css:
.auto-cursor {
  cursor: default;
}
atom-panel.left kite-sidebar .kite-column {
  padding-right: 5px;
}
atom-panel.left kite-sidebar .kite-sidebar-resizer {
  order: 2;
}
atom-panel.right kite-sidebar .kite-column {
  padding-left: 5px;
}
atom-panel.right kite-sidebar .kite-sidebar-resizer {
  order: 0;
}
kite-sidebar {
  display: flex;
  font-size: 1em;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  flex-direction: row;
}
kite-sidebar .kite-sidebar-resizer {
  width: 5px;
  cursor: ew-resize;
  flex: 0 0 auto;
}
kite-sidebar h4 .sticky.fixed {
  background: #21252b;
}
kite-sidebar .btn.icon-x {
  border: 1px solid transparent;
  background: transparent;
  transition: border 0.2s, background 0.2s;
}
kite-sidebar .kite-column {
  display: flex;
  padding: 10px;
  flex-direction: column;
  order: 1;
  flex: 1 1 auto;
  overflow: hidden;
}
kite-sidebar .background-message {
  opacity: 0.5;
}
kite-sidebar .background-message kite-logo {
  display: block;
}
kite-sidebar .background-message kite-logo svg {
  width: 2em;
}
kite-sidebar .background-message kite-logo svg polygon {
  fill: #9da5b4;
}
kite-sidebar kite-navigable-stack,
kite-sidebar kite-navigable-stack-breadcrumb {
  flex: 1 1 0;
  overflow: hidden;
}
kite-sidebar kite-navigable-stack .sections-wrapper section.summary:empty {
  display: none;
}
kite-sidebar header {
  margin-bottom: 10px;
  display: flex;
  flex-direction: row;
  justify-content: flex-end;
}
kite-sidebar header kite-navigable-stack-breadcrumb {
  align-items: center;
}
kite-sidebar footer {
  display: block;
  align-items: flex-end;
  align-content: space-around;
  justify-content: flex-end;
  flex: 0 0 auto;
}
kite-sidebar footer {
  padding-top: 10px;
}
